(defn delete-all-game-events []
   (with-client client
   (doseq [item (scan liveGameTable {})]
   (delete-item liveGameTable (create-key (:game_ID item) (:game_clock_uuid item))))
   (is (empty? (scan liveGameTable {}))))
)

